import "./App.css";
import SignUp from "./components/signup";
import SignIn from "./components/signin";
import Services from "./components/servicespage";
import { Route, Routes } from "react-router-dom";
import ForgotPassword1 from "./components/resetPassword/forgotpassword1";
import ForgotPassword2 from "./components/resetPassword/forgotpassword2";
import HomePage from "./components/homepage";
import ProductPage from "./components/productpage";

function App() {
  return (
    <Routes>
      <Route
        path="/product"
        render={(props) => {
          <ProductPage {...props} />;
        }}
      />
      <Route path="/services" element={<Services />} />
      <Route path="/sign-in" element={<SignIn />} />
      <Route path="/sign-up" element={<SignUp />} />
      <Route path="/forgot-password-1" element={<ForgotPassword1 />} />
      <Route path="/forgot-password-2" element={<ForgotPassword2 />} />
      <Route path="/" element={<HomePage />} />
    </Routes>
  );
}

export default App;
